import styled from 'styled-components/native';

export const SubmitButton = styled.View `
    width: 60%;
    padding: 1%;
    border-radius: 50px;
    background: #FF4D00;
    margin-top: 5%;
`;

export const Input = styled.TextInput `
    width: 100%;
    padding: 3%;
    padding-left: 5%;
    background-color: #fff;
    border-radius: 100; 
    box-shadow: 2px 2px 4px rgba(0, 0, 0, 0.25);
`;
